import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract TobiXI is ERC20("TobiXI Token", "TBXI") {
    address public owner;

    constructor() {
        owner = msg.sender;
        _mint(msg.sender, 100000e18);
